	DECLARE FiscalYearMonthsOffset INT;
	DECLARE DateCounter DATETIME;   
	DECLARE FiscalCounter DATETIME; 

	SET FiscalYearMonthsOffset = 6;
	SET DateCounter = BeginDate;

	WHILE DateCounter <= EndDate DO

