		IF MONTH(DateCounter) = MONTH(DATE_ADD(DateCounter, INTERVAL 1 DAY)) THEN SET LastDayOfMon = 'N';
		ELSE SET LastDayOfMon = 'Y';
		END IF;

		INSERT INTO dim_date
			(date_key
			,full_date
			,date_name
			,date_name_us
			,date_name_eu
