			,fiscal_month_of_year
			,fiscal_quarter
			,fiscal_year
			,fiscal_year_month
			,fiscal_year_qtr)
		VALUES(
			( YEAR(DateCounter) * 10000 ) + ( MONTH(DateCounter) * 100 ) + DAY(DateCounter)
			, DateCounter 
